import LevelBuilderfrom sprites import *def render(name,bg):	lb = LevelBuilder.LevelBuilder(name+".plist",background=bg)	lb.addObject(Beam.BeamSprite(x=241, y=27,width=91,height=38,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ).setName('SwingBeam'))	lb.addObject(Enemy.EnemySprite(x=105, y=33,width=62,height=62,angle='0',restitution=0.2,static='false',friction=0.8,density=20 ).setName('Enemy'))	lb.addObject(Hero.HeroSprite(x=440, y=20,width=32,height=32))	lb.addObject(Nut.NutSprite(x=242, y=292,width=19,height=19,eventName='onNutHit' ,restitution=0.2,static='true',friction=0.5,density=20 ).setName('Nut'))	lb.addObject(Joints.DistanceJoint(body1='SwingBeam',body2='Nut',damping='0.2',freq='5' ))	lb.addObject(Enemy.EnemySprite(x=105, y=96,width=62,height=62,angle='0',restitution=0.2,static='false',friction=0.8,density=20 ).setName('Enemy'))	lb.addObject(Enemy.EnemySprite(x=105, y=160,width=62,height=62,angle='0',restitution=0.2,static='false',friction=0.8,density=20 ).setName('Enemy'))	lb.addObject(Enemy.EnemySprite(x=105, y=224,width=62,height=62,angle='0',restitution=0.2,static='false',friction=0.8,density=20 ).setName('Enemy'))	lb.addObject(Enemy.EnemySprite(x=105, y=287,width=62,height=62,angle='0',restitution=0.2,static='false',friction=0.8,density=20 ).setName('Enemy'))	lb.addObject(Star.StarSprite(x=27, y=19,width=32,height=32))	lb.render()